import React from 'react';

const Header = () => {
  return (
    <header>
      <h1>This is practice page</h1>
      <nav>
        <a href="#home">Home</a>
        <a href="#about">About</a>
        <a href="#contact">Contact</a>
        <a href="#login">Login</a>
        <a href="#signup">Signup</a>/*클릭하면 이동함*/
      </nav>
    </header>
  );
};

export default Header;
